import React, { Component } from "react";
import { Joystick } from 'react-joystick-component';

class Teleoperation extends Component{
    state = {}

    handleMove(){}
    handleStop(){}

    render(){
        return ( 
        <div>
            <Joystick size={100} sticky={true} baseColor="red" stickColor="blue" move={this.handleMove()} stop={this.handleStop()}></Joystick>
        </div>);
    }
}

export default Teleoperation;
